本物のカーボンを採用しながら由にカットの出来き、曲面にも貼れるマジカルカーボン。リアルカーボンならではの質感は他製品を圧倒します。サイドピラーパネルにあわせてカット済みで貼り付けるだけで施工できます。 <br><br>ハセプロ独自の特殊加工を施している為カット面が毛羽立たず 、カーボン繊維に沿って伸ばす事が出きるのである程度の曲面等に貼り付ける事が可能でキレイな仕上がりが可能となります。また、対候性にも優れており、耐候５年、ヒートサイクル℃１３０度からー３０度を５回転させて劣化や剥がれ等のテストにも合格してます。<br><br>■カラー:ブラック <br><br>GRE156H ブレイドマスター(2006/12～2009/11) <br><br>車検対応品<br><br>グッズ・アクセサリー/グッズアクセサリーその他<BR>※こちらの商品は代金引き換え不可となっております。ご了承ください。<tr><td colspan="2">
